import React from 'react';
import './carousel.css';
import {CarouselData} from './carousel_data';
import CarouselInner from './carousel_inner.js';
import CarouselSlide from './carousel_slid.js';

class Carousel extends React.Component{
  render(){
    return(
      <div>
        {CarouselData.map((item,index) => {
          <ul key={index} className="carousel-indicators ">
          <li data-target="#demo" data-slide-to={item.number} className={item.class}></li>
          </ul>
        })}
        <CarouselInner/>
        <CarouselSlide/>
      </div>
    )
  }
}
export default Carousel
